import React, {useState} from 'react';

export default class Backend extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        };
    }

    componentDidMount() {
        fetch("https://api.sheety.co/a059a44709599c766a704967b9cc3d24/subscribers/subscribers")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        subscribers: result.subscribers
                    });
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });
                }
            )
    }

    renderTableData(){
        return this.state.subscribers.map(subscriber => (
                <tr key={subscriber.id}>
                    <tb>{subscriber.fullName}</tb>
                    <tb>{subscriber.gender}</tb>
                    <tb>{subscriber.emailAddress}</tb>
                    <tb>{subscriber.state}</tb>
                </tr>
            ))
    }

    render() {
        const { error, isLoaded, subscribers } = this.state;
        if (error) {
            return <div>Error: {error.message}</div>;
        } else if (!isLoaded) {
            return <div>Loading...</div>;
        } else {
            return (
                <div>
                    <h1 id='title'>SUBSCRIBERS</h1>
                    <table id='subscribers'>
                        <tbody>
                        {this.renderTableData()}
                        </tbody>
                        </table>
                </div>
            );
        }
    }
}

